import React from 'react';

export default function SVGFog({ className }) {
  return (
    <svg
      className={className}
      width="1000"
      height="1000"
      viewBox="0 0 1000 1000"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      style={{ filter: 'blur(60px)' }}
    >
      {/* High opacity, smaller, less blur for unmistakable fog */}
      <ellipse cx="0" cy="1000" rx="600" ry="400" fill="#fff" fillOpacity="0.35" />
      <ellipse cx="0" cy="1000" rx="350" ry="250" fill="#fff" fillOpacity="0.22" />
    </svg>
  );
}
